import React , {useRef, useEffect, useState} from 'react';
import './style.css';
import Button from '../../components/Button';
import Label from '../../components/Label';
import { Link } from 'react-router-dom';

function UserRegisterPage() {
	const [inputs, setInputs] = useState({});
	const [isShown, setIsShown] = useState(false);

	// Field Errors
	const [nameError, setNameError] = useState(null);
	const [idError, setIdError] = useState(null);
	const [yearError, setYearError] = useState(null);
	const [majorError, setMajorError] = useState(null);


	const handleChange = (event) => {
		const name = event.target.name;
		const value = event.target.value;

		setInputs(values => ({...values, [name]: value}))
	}

	async function componentDidMount() {
		const response = await fetch("http://localhost:3001/", {
			method: 'POST',
			headers: {
				'Accept': 'application/json',
				'Content-Type': 'application/json'
			},
			body: JSON.stringify(inputs)
		});

		if(response.ok) return setIsShown(current => !current)

		const data = await response.json();

		if(data['error']['id']) return console.log("Show ever")
	}

	const handleSubmit = (event) => {
		event.preventDefault();

		componentDidMount();
		// setIsShown(componentDidMount());
	}

	const ref = useRef(null);

	useEffect(() => {
		const element2 = ref.current;
		console.log(element2);
	})

// 	// Example starter JavaScript for disabling form submissions if there are invalid fields
// (() => {
// 	'use strict'

// 	// Fetch all the forms we want to apply custom Bootstrap validation styles to
// 	const forms = document.querySelectorAll('.needs-validation')

// 	// Loop over them and prevent submission
// 	Array.from(forms).forEach(form => {
// 	  form.addEventListener('submit', event => {
// 		if (!form.checkValidity()) {
// 		  event.preventDefault()
// 		  event.stopPropagation()
// 		}

// 		form.classList.add('was-validated')
// 	  }, false)
// 	})
//   })()
  	return (
		  <div className='container'>
			{!isShown &&
			(
				<div className='register'>
					<div className='d-flex justify-content-center'>
						<Label text='Welcome to Secure Password! Please Register' ></Label>
					</div>
					<form className="row g-3 needs-validation" novalidate onSubmit={handleSubmit}>
						<div class="col-6 mb-4">
							<label for="validationCustom01" className="form-label">Student Name:</label>
							<input type="text" ref={ref} className="form-control" name="name" placeholder='Enter your name' onChange={handleChange}/>
							<div class="valid-feedback">
							Looks good!
							</div>
						</div>
						<div class="col-6 mb-4">
							<label for="validationCustom01" className="form-label">Student ID:</label>
							<input type="text" className="form-control" name="id" placeholder='Enter your HCT ID' onChange={handleChange}/>
							<div class="valid-feedback">
							Looks good!
							</div>
						</div>
						<div class="col-6 mb-4">
							<label for="validationCustom01" className="form-label">Student Major:</label>
							<input type="text" className="form-control" name="major" placeholder='Enter your Major' onChange={handleChange}/>
							<div class="valid-feedback">
							Looks good!
							</div>
						</div>
						<div class="col-6 mb-4">
							<label for="validationCustom01" className="form-label">Student Year:</label>
							<input type="text" className="form-control" name="year" placeholder='Enter your Year' onChange={handleChange}/>
							<div class="valid-feedback">
							Looks good!
							</div>
						</div>
						<div className='row d-flex justify-content-center'>
							<div className='col-4 d-flex justify-content-center'>
								<Button text="Register" submit="true" className="w-25"></Button>
							</div>
						</div>
					</form>
				</div>
			)}

			{isShown && (
				<div className='registerConfirmed'>
					<div className='d-flex justify-content-center'>
						<Label text='Registration Confirmed'></Label>
					</div>
					<p className='text-center fs-4'>
						Your registration process is completed. Now you can use the website to test the strength of your desired password.
					</p>
					<div className='row d-flex justify-content-center'>
						<div className='col-6 d-flex justify-content-center'>
							<Link to='/testPassword'><Button text="TEST THE PASSWORD NOW" submit="true" color="#2e5582" fontWeight="bold" className="w-25"></Button></Link>
						</div>
					</div>
				</div>
			)}
		</div>
  	)
}

export default UserRegisterPage;
